import React, { useState } from "react";
import Components from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Components/Navbar";
//import data from "./Components/states.json"
import Section from "./Components/Section";
import dummyText from "./DummyText";


class App extends Components {


  render() {
    return (
      <div className="App">
        <Navbar />
        <Section
          title="Financial Literacy in The U.S."
          subtitle={dummyText}
          dark={true}
          id="section1"
        />
        <Section
          title="Section 2"
          subtitle={dummyText}
          dark={false}
          id="section2"
        />
        <Section
          title="Section 3"
          subtitle={dummyText}
          dark={true}
          id="section3"
        />
        <Section
          title="Section 4"
          subtitle={dummyText}
          dark={false}
          id="section4"
        />
        <Section
          title="Section 5"
          subtitle={dummyText}
          dark={true}
          id="section5"
        />
      </div>
    );
  }
}



export default App;
